#!/usr/bin/env python3

class Solution(object):
    def isValid(self, input):

        dict_brackets = {
            '(' : ')',
            '{' : '}',
            '[' : ']'
        }

        out = []
        for item in input:
            if item in dict_brackets:
                out.append(item)
            elif out and item == dict_brackets[out[-1]]:
                out.pop()
            else:
                return False

        return out == []
                
        

